// src/OverviewPage.js
import React from 'react';
import { useHistory } from 'react-router-dom';
import { Box, Button, Typography } from '@mui/material';

function OverviewPage() {
  const history = useHistory();

  const handleStart = () => {
    // Navigate to the main application page.
    history.push('/app');
  };

  return (
    <Box
      sx={{
        height: '100vh',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        background: '#FAF5E9',
        textAlign: 'center',
        p: 2,
      }}
    >
      {/* Display your overview image (place the image file, e.g., ml.png, in your public folder) */}
      <img
        src="/ml.png"
        alt="Machine Learning Overview"
        style={{ maxWidth: '100%', width: '500px', borderRadius: '8px', marginBottom: '20px' }}
      />
      {/* Optional: Display any overview text or keep it minimal */}
      <Typography variant="h5" sx={{ mb: 2, color: '#333' }}>
        Welcome to the Machine Learning Model Trainer
      </Typography>
      <Button variant="contained" onClick={handleStart} sx={{ fontSize: '1.2rem', px: 3, py: 1 }}>
        Let's Start
      </Button>
    </Box>
  );
}

export default OverviewPage;
